      <path strokeLinejoin="round" d="M10.463 11.585l-.402 2.524 2.523-.403 7.023-7.022-2.122-2.121z" />
      <circle cx="5" cy="5" r="1.5" />
      <circle cx="5" cy="19" r="1.5" />
      <circle cx="19" cy="19" r="1.5" />
      <path d="M6.5 5H12M5 6.5v11M6.5 19h11M19 17.5V12" />
    </g>
  </svg>
);
